import React from 'react';
import "./styles/JoinRoom.css"
const JoinRoom = () => {
    return (
        <div className="flex-container">
            <div class="flex-rooms">
                <div><h1>Einem Raum beitreten</h1></div>
                <div class="flex-rooms"></div>
            </div>
        </div> 
    )
}

export default JoinRoom
